// css
import { profile } from "console";
import "../css/pageheader.css";

import React, { memo, useEffect, useState } from "react";
import { Link } from "react-router-dom";

import Head from "../image/head.jpg";

interface ModalProps {
  state: boolean;
  type: string;
}

export const PageHeader = () => {
  let [check, setCheck] = useState<boolean>(true);

  return (
    <header className="pwf_header">
      <span>
        <Link to="/result" className="home_anchor">
          PWF
        </Link>
      </span>

      <div className="pwf_user_box">
        <button className="pwf_user_btn">
          <img src={Head} />
        </button>

        <div className="check_box"></div>
      </div>
    </header>
  );
};
